import Link from "next/link";

const Header = () => (
  <>
    <div className="navbar">
      <div className="wrapper">
        <Link href="/">
          <a className="navlink">HOME</a>
        </Link>
        <Link href="/about">
          <a className="navlink">ABOUT</a>
        </Link>
      </div>
    </div>
    <style jsx>
      {`
        .wrapper {
          display: flex;
          flex-direction: column;
          justify-content: center;
          height: 100px;
          margin-left: 15px;
          position: fixed;
          text-align: center;
          top: 45vh;
          z-index: 1;
        }

        .navlink {
          color: #3366cc;
          font-family: "Futura";
          margin: 50px 0;
          text-decoration: none;
          transform: rotate(-90deg);
        }

        .navlink:hover {
          opacity: 0.6;
        }
      `}
    </style>
  </>
);

export default Header;
